int32_t data_Find_std(const int32_t * len_vec, int32_t len){
    if(len_vec != nullptr && len >= 0){
        int i = 0;
        while(len_vec[i] >= 0){
            if(len_vec[i] == len){
                return i;
            }
            i++;
        }
    }
    return -1;
}

